import Link from 'next/link'
import { getStatus } from '../lib/posts'

const Index = props => {
  console.log(props)
  return (
    <div>
      <h1>トップページ</h1>
      <p>現在はサーバー側で{props.isServer? 'ござる' : 'ござらない'}</p>
      <Link href="/about">
        <a>About</a>
      </Link>
    </div>
  )
}

export async function getStaticProps() {
  return {
    props: {
      isServer: typeof window === 'undefined'
    }
  }
}

export default Index
